export default function Header3 (){
const bar =()=>{
if(
    document.getElementById('base').style.width=='200px')
    {
        document.getElementById('base').style.width='0px'}
else{
    document.getElementById('base').style.width='20%'}

};
return(
<>
<div className="bg-color">

   <p onClick={bar} className='bar g-base'><i className="fa fa-bars"> </i></p>

<form>

<input className="s-bar" type="text" placeholder="Search"/>


</form>

<div className="f-base">
<a className='bar margin'><i className="fa fa-envelope"><span className="span">Message</span> </i></a>

<a className='bar margin'><i className="fa fa-bell"><span className="span">Notification</span> </i></a>


<a className='bar margin'><img src="##"/><span className="span">Aman</span> </a>


</div>





</div>


<div className="bar2" id="base">
<p ><i class="fa fa-user bar bar1"><span className="span">Dark Mod</span></i></p>
<p className="pl"><i class="fa fa-tachometer sidebar"><span className="span1">Dark Mod</span></i></p>
<p className="pl"><i class="fa fa-laptop"><span className="span1">Dark Mod</span></i></p>
<p className="pl"><i class="fa fa-th"><span className="span1">Dark Mod</span></i></p>
<p className="pl"><i class="fa fa-keyboard-o"><span className="span1">Dark Mod</span></i></p>
<p className="pl"><i class="fa fa-table"><span className="span1">Dark Mod</span></i></p>
<p className="pl"><i class="fa fa-bar-chart"><span className="span1">Dark Mod</span></i></p>
<p className="pl"><i class="fa fa-file "><span className="span1">Dark Mod</span></i></p>
</div>

</>

)

}
